    <section class=""glimpse container"">
      <div class=""Gnece TAJ MRB"">
        <h1><em>aglimpse into 
            who we are …</em>
        </h1>

        <h2>NCEC</h2>

        <p><strong>NCEC Group is a family-owned group of mid-sized companies with over six decades experience in business. We specialize in representing international companies in Nepal. </strong></p>

        <p>NCEC pioneered the Representation business in Nepalwith its incorporation on September 8, 1958 by Indra Mani Rajbhandari. Our businessof REPRESENTING international companies providing global solutions in Nepal is still core to our operations. We have supported more than 100 companies from all over the globe acquire business. As a family-owned company, the NCEC Group focuses on long-term investment strategies for sustainable growth. We aim for majority shareholdings and wherever the market situation requires, we also engage in minority participations or joint ventures. </p>

        <p>Our organisation is made up of f");
            WriteLiteral(@"ive business verticals with a diversified portfolio of selected products and services. We have strategic investments (equity holding) in the energy, hospitality, banking and insurance sector in Nepal. We have our base in Kathmandu Nepal, with a broad nation-wide presence and network of partners from around the world.Our working model is lean and efficient aimed to provide support in strategic and financial matters, business development and offer guidance regarding core strategic initiatives. We encourage co-ownership of with our key employee managing the business. This allows us to ensure that the management maintains the necessary flexibility to enable a dynamic growth according to the growth in the market.</p>

        <p>We aim to increase our profitability by continuously building and developing a competent and dynamic team. This team is united by a strong belief that employees are the number one success factor in every corporation. Furthermore, we are particularly focused on the long-term improvement o");
            WriteLiteral(@"f customer experience and making the most of the opportunities provided by digitalisation and globalisation.Our mission is to work towardsproviding outstanding technical solutions in our areas of business, thereby improving processes , developing employee skills , increasing in profitability.We command more than 40% market share in most of the business segments we operate and our nationwide presence helps us uphold high level of customer satisfaction.</p>

        <h3>As a team, we believe in “Sustainable Partnership”, and our promise is : “putting quality first”. </h3>
      </div>


      <div class=""Heritage TAJ MRB"">
          <div class=""heri"">
            <h2>HERITAGE</h2>
            <p>The Group’s root can be found in the visionary and entrepreneurial spirit of Late Indra Mani Rajbhandari, with the foresight to create a company in Nepal bridging a gap for international companies and Nepal’s development aspiration. </p>
          </div>
          <div class=""chairman"">
            <h3>Found");
            WriteLiteral(@"er Chairman - Indra Mani Rajbhandari</h3>
            <p>Subba Indra Mani Rajbhandari established his business venture in 1958 after completing his tenure as Regional Administrator to Govt. of Nepal. NCEC (then known as NECOENCO Group) </p>
          </div>
          <div class=""mentor"">
            <h3>Our Mentor - Dibya Mani Rajbhandari</h3>
            <p>Hon. Dibya Mani Rajbhandaritook over the organization on the unexpected untimely death of its founder. He led the organization for 40 year to greater heights and ventured into establishment and investment as promotors founders in the banking and insurance sector. Mr. Rajbhandari also established the first Bi-Lateral business chamber, the Nepal German Chamber and founded the European Economic Chamber too. He has played a leading role in the business and economic diplomacy as Member of Prime Minister G.P. Koirala’s Economic Council. With deep interest in public service, Dibya Mani is currently serving the nation’sas Member of the Federal Parliament.</p");
            WriteLiteral(@">
            <p>He transferred the management and ownershipof his business NCEC to his two sons</p>
          </div>
      </div>


      <div class=""Vision TAJ MRB"">
        <h2>VISION &VALUES </h2>
        <h3>NCEC vision of “ Sustainable Partnership” means we believe in longevity, dependability, and morality. </h3>
        <p>We drive our vision by engaging with our employees by investing in human resource by developing them to be customer oriented , skilled and happy with an aim that our team is customer oriented and highly devoted.After it is all about people !</p>
        <p>We select partner companies that have strong tradition of innovation and investment in R&D . These companies manufacture amongst the best products in their category globally and are market leaders in innovation. This helps us in branding ourselves as dependable.</p>
        <p>We are committed in providing our customers’ expectations with quality product. We believe we achieve our promise by choosing the correct partner ");
            WriteLiteral(@"with innovative products and training a technically skilled people in our team. Keeping customer’s investment in our heart, we invest in our resources to ensure their sustainability. </p>
        <p>We have a transparent financial reporting system allowing our government to generate the due revenue as taxes from the profits that we earn. We are amongst the oldest tax payers in Nepal.  We maintain high moral grounds !</p>
        <p>We believe in close collaboration with customers, business partners, colleagues and other stakeholders.</p>
        <h3>Our promise is our core value – “ putting quality first ” – places a competitive advantage that help us maintain our leadership position, even in a changing environment.</h3>
      </div>

      <div class=""Startegy TAJ MRB"">
