          <p><strong>We invest in areas that create value to our customers, our employees, our environment, our society, our partners and our shareholders.</strong></p>
          <p>To implement and achiev");
            WriteLiteral(@"e our vision of “sustainable partnership”, we drive our business with the following strategies. </p>

                <h3>PRESENCE</h3>
                <p class=""pmarbot"">For us, Presence means being where our customers are and making sure we are close by when they need us. But presence is not only about geography. It is also about being in the right market segments with the best products and service capabilities. We strive to be present in our customer’s mind and heart! In Nepal, our presence is all seven provinces, all major industrial clusters, and all major construction sites. </p>
                <p class=""PPQp""><strong>We know that presence mean to be in the hearts and minds of our customers!</strong></p>


                <h3>PEOPLE</h3>
                <p class=""pmarbot"">We are proud that our employees are happy, honest and dedicated. To maintain a fleet of skilled human resources we are constantly investing in developing new talent. Through the Training program at our partners facilities we e");
            WriteLiteral(@"nsure the high level of skill required for our people. Further, we believe growing our people from new talent to mature leaders in the organization. The people is what makes an organization and this is what we believe in. </p>
                <p> class=""PPQp<strong>We value our people as the strongest pillar of our organization!</strong></p>


                <h3>PARTNERS</h3>
                <p class=""pmarbot"">We partner with companies that manufacture well-engineered products that have a global footprint and are amongst the top in their product segment. Our partners have a tradition of innovation and large investment in research and development. Such partners give us confidence of quality and innovative products while presenting ourselves to our customers ! </p>
                <p class=""PPQp""><strong>Our partners are leaders in their industry segments & amongst best in the world!</strong></p>


                <h3>QUALITY PRODUCTS & SOLUTION </h3>
                <p class=""pmarbot"">The products t");
            WriteLiteral(@"hat we market increase customers’ productivity and competitiveness. We invest with partners who invest in research and development and who are introducing new products that deliver improved reliability and energy efficiency. Quality products mean higher reliability for our customers, thus, all leading to customer satisfaction. Our diversified product portfolio helps us reach customers with a solution in some form or other. </p>
                <p class=""PPQp""><strong>We believe in delivering the best products and solution from all corners of the globe!</strong></p>


                <h3>DEDICATED SERVICE</h3>
                <p class=""pmarbot"">Our customers want the reassurance that comes from knowing their equipment and machinery will run smoothly. Today we invest in human resources to convert them to human capital. A dedicated MRO organization for each of our business areas with trained and skilled technicians helps our customers keep their machine running smoothly ensuring their happiness. </p>
     ");
            WriteLiteral(@"           <p class=""PPQp""><STRONG>We emphasize on service as key indicator to customer happiness!</STRONG></p>
      </div>


      <div class=""Business TAJ MRB"">
          <h2>BUSINESS VERTICALS </h2>
          <p>We operate under these Five Business Verticals </p>


          <h3>REPRESENTATION</h3>
          <p class=""PPQp"">NCEC core operation is as Representative Agent for Value Added Liaision Services. NCEC represents international companies from sectorsEPC contractors, equipment and machinery manufacturers, engineering consultancy companies, manufacturers of power and energy systems,  and large trans-national trading companies. The business caters to large hydro power plants, power stations, manufacturing units, irrigation projects, road, highway and bridges project, other physical infrastructure projects, government procurement for goods and material, etc.  A dedicated team supports international companies in preparing their bids for opportunities in procurement eco-system in Nepal for both ");
            WriteLiteral(@"private and government requirements. We support our partners with Legal and Regulatory services, Financial and Accounting services, Supply Chain and Logistics services, Office Management and secretarial services, and Human Resource services, as and when required! </p>

          <h3>CONSULTANCY (Engineering & Management)</h3>
          <p class=""PPQp"">NCEC provides variety of engineering and business services to its partners for their smooth operation in Nepal. As partners of engineering consultants, this segment focuses in supporting with required engineers and manager for feasibility studies, construction supervision and project management consultants.</p>

          <h3>HOSPITALITY& TRAVEL </h3>
          <p>NCEC has investment in the hospitality sector since 1992 with its partnership in the BanchaGhar Nepali restaurant. Thereafter it has invested and divested in a few hospitality projects. For the future, the hospitality investment company is working towards developing a Eco-Friendly family holiday ");
            WriteLiteral(@"destination in the foothills of the Himalayas.</p>
          <p class=""PPQp"">We also operate a travel assistance company helping international travelers if need arrives! </p>

          <h3>DISTRIBUTORSHIP</h3>
          <p >NCEC operates are channel partners for multinational companies involved inconstruction and mining equipment, tunneling and underground works, industrial machinery solutions, from around the world that have global leaders in their business segments catering to Nepal’s physical infrastructure sector and industrial process segments. Two strategic companies: NCEC Equipment and Services (for Construction and Infrastructure) and NCEC Industrial Services (Manufacturing and Industrial process) cater to the target customer segment. We are distributors of Channel Partners for Atlas Copco Compressor Technique, Atlas Copco Industrial Technique, Atlas Copco Power Technique, Epiroc, & Dynapac. </p>
          <p>As part of the Distributorship business model, we have a dedicated MRO and Rental secti");
            WriteLiteral(@"on: </p>
          <p><u>Maintenance, Repair & Overhaul (MRO) :</u>NCEC Maintenance Repair and Overhaul Team is trained to manage equipment and machinery in portfolio. We provide services to our customers keeling in mind that that an ideal machine is lost investment. Our Teams of Technicians are headed by experienced and competent Engineers with knowledge and skill. The skills are jointly developed by the principal manufacturers that we represent and our learning modules. </p>
          <p class=""PPQp""><u>Equipment Rental:NCEC </u>‘s Rental business is solely for the products from our portfolio . Our product portfolios are in air compressors, road construction equipment, mining equipment, shortcrete equipment, formwork shuttering system and tools.</p>


          <h3>INVESTMENTS on Public Placements</h3>
          <p>NCEC has strategic investment public holdings in listed companies and publically traded companies. Our investment portfolio are mostly in publicly listed banks and insurance companies.</p>");
